  //give comment
  useEffect(() => {
    //give comment
    axios.get('https://jsonblob.com/api/jsonblob/1287718524221775872')
      .then((response) => {
        console.log(response.data);
        setMovies(response.data.movies);
      })
      .catch((error) => {
        console.log(error);
      });
  });

  return (
    <div>
      <h2>This is my Read Component.</h2>
      <Movies myMovies={movies} />
    </div>
  );
}

